import { Pokemon } from './pokemon';

export const POKEMON: Pokemon[] = [
  { id: 1, name: 'Bulbasaur', picture: "../assets/bulbasaur.png"},
  { id: 2, name: 'Ivysaur', picture: "../assets/ivysaur.png"},
  { id: 3, name: 'Venusaur', picture: "../assets/venusaur.png"},
];
